import React from "react";

const Won_display = (props) => {
    let para = "";
    let x = props.x;
    let y = props.y;
    let z = props.z;

if ((x === y) && (y === z)){
    return(
        <>
         <div className="puzzlebox">
                    <div>
                        <h1>{x} {y} {z}</h1>
                        <h1>The above 3 contents are matching. You Won!!</h1>
                    </div>
                </div>
        </>
    );
}


else {
    return(
        <>
         <div className="puzzlebox">
                    <div>
                        <h1>{x} {y} {z}</h1>
                        <h1>The above 3 contents are not matching. You Won!!</h1>
                    </div>
                </div>
        </>
    );
}

}




export default Won_display;
